    "description" : "<p style=\"text-align: justify;\">SimpleCarry là thương hiệu Ba lô, Túi xách sản xuất tại Việt Nam theo tiêu chuẩn Mỹ. Vải trượt nước &amp; kháng bụi. Luôn đi đầu xu hướng thời trang với nhiều mẫu mã phù hợp với mọi đối tượng khách hàng.</p>\n<p style=\"text-align: justify;\"><strong><img src=\"https://salt.tikicdn.com/ts/tmp/f4/d3/7f/f19fbae4484d2f79cb3a9f6784ac08ef.jpg\" alt=\"Balo SimpleCarry B2B05 (12 x 37 cm)\" width=\"750\" height=\"337\" /></strong></p>\n<p style=\"text-align: justify;\"><strong>Balo Laptop 14 inch SimpleCarry B2B05</strong> được may từ chất liệu vải Polyester chống thấm nước và kháng bụi tốt, hỗ trợ bạn đi mưa hay vô tình bị đổ tràn nước lên balo trong quá trình sử dụng.</p>\n<p style=\"text-align: justify;\"><strong><img src=\"https://salt.tikicdn.com/ts/tmp/ff/7a/4a/674a2609cfc56451c645a1f19f45b1dc.jpg\" alt=\"Balo SimpleCarry B2B05 (12 x 37 cm)\" width=\"750\" height=\"436\" /></strong></p>\n<p style=\"text-align: justify;\">Balo Laptop 14 inch chính hãng SimpleCarry B2B05 có kích thước 37 x 26 x 12 (cm) nhỏ gọn, chỉ 0.69 (kg) mỏng nhẹ, vừa tầm tay dễ cầm nắm hay mang đi bất cứ đâu mà không bị vướng víu. Nhưng balo lại chứa được trọng tải tối đa 25 (kg) giúp bạn đựng được nhiều đồ vật, đồ cá nhân, laptop,  tránh bị quên khi ra ngoài.</p>\n<p style=\"text-align: justify;\"><img src=\"https://salt.tikicdn.com/ts/tmp/00/1b/68/67ea3a18b73fa97cedb1019ba9209dbb.jpg\" alt=\"Balo SimpleCarry B2B05 (12 x 37 cm)\" width=\"750\" height=\"750\" /></p>\n<p style=\"text-align: justify;\">Balo Laptop chính hãng SimpleCarry dòng B2B05 gồm 3 ngăn: 1 ngăn chính và 2 ngăn phụ, tổng quan được thiết kế là hình hộp đứng với dây kéo chắc chắn, êm, mượt, dễ sử dụng.</p>\n<p style=\"text-align: justify;\"><img src=\"https://salt.tikicdn.com/ts/tmp/88/3b/b9/15c14708d90b2c3706593c525e11dcfc.jpg\" alt=\"Balo SimpleCarry B2B05 (12 x 37 cm)\" width=\"750\" height=\"750\" /></p>\n<p style=\"text-align: justify;\">Mặt trước Balo B2B05 được đính LOGO hình chữ nhật bằng da được may ở bên phải phía trên của balo rất bắt mắt và dễ dàng nhìn thấy. Balo rất nhiều ngăn gồm: ngăn chính phía trước lớn có đầu khóa kéo đựng sổ tay, kindle, kèm ngăn dắt viết, điện thoạ ngăn phụ trước đựng thẻ xe, tiền lẻ,  Bên trong ngăn chính là túi vuông rộng, có ngăn phụ bên trong đựng Laptop, Macbook,  riêng biệt với lớp mút PE chống sốc. Ngăn lưới phụ bên trong đựng Adaper, phone, sạc.<img src=\"https://salt.tikicdn.com/ts/tmp/1e/68/45/38662008db677fc743dddbbccb584bd7.jpg\" alt=\"Balo SimpleCarry B2B05 (12 x 37 cm)\" width=\"750\" height=\"750\" /></p>\n<p style=\"text-align: justify;\">Quai đeo của Balo B2B05 được may bằng kỹ thuật gấp mép dây viền, có label logo may trên quai đeo, thiết kế ôm rất sát hai vai, chắc chắn, điều chỉnh nới dài – thu ngắn dây đeo theo chiều cao người dùng vô cùng linh hoạt. Chức năng 2 trong 1 bởi quai xách được may phía trên quai đeo như một túi xách, an tâm sử dụng mỗi ngày.</p>\n<p style=\"text-align: justify;\"><img src=\"https://salt.tikicdn.com/ts/tmp/ec/2c/f9/3da6448610f1af069d15c7f7c596b3b1.jpg\" alt=\"Balo SimpleCarry B2B05 (12 x 37 cm)\" width=\"750\" height=\"750\" /></p>\n<p style=\"text-align: justify;\"> </p>\n<p style=\"text-align: justify;\">Dòng B2B05 này có 5 màu chọn lựa: Xám, Đen, Xanh, Đỏ, Nâu.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>",
